using namespace std;
 
typedef long long ll;
 
class BinaryPolynomialDivOne {
public:
  int findCoefficient(vector<int> a, long long m, long long k) {
    int n = a.size();
    map<ll, int> am;
    am[k] = 1;
    for (int pw = 60; pw >= 0; --pw) {
      if (m >> pw & 1) {
        ll mx = 0;
        for (int j = 0; j < pw; ++j) {
          mx += (n - 1) * (1LL << j);
        }
        map<ll, int> nam;
        for (map<ll, int>::iterator it = am.begin(); it != am.end(); ++it) {
          ll rem = it->first;
          int w = it->second;
          if (!w)
            continue;
          for (int i = 0; i < n; ++i) {
            if (a[i]) {
              ll cur = (1LL * i) << pw;
              if (rem >= cur) {
                ll nrem = rem - cur;
                if (nrem <= mx) {
                  nam[nrem] ^= w;
                }
              }
            }
          }
        }
        am = nam;
      }
    }
    return am[0];
  }
};
 
 
